import "./explore.css"
import PostSquare from "../../components/PostSquare/PostSquare";
import {useDispatch, useSelector} from "react-redux";
import {useEffect} from "react";
import {fetchProfilePosts, getProfilePosts} from "../../redux/postsSlice";

const Explore = ({userId}) => {

    const dispatch = useDispatch()
    const post = useSelector(getProfilePosts)

    useEffect(() => {
        dispatch(fetchProfilePosts({userId}))
    }, [userId]);


    return (
        <div className="explore-container">
            <div className="gallery">
                {post.map(post => <PostSquare key={post._id} post={post}/>)}
            </div>

        </div>
    )
}

export default Explore
